import React from 'react';
import img_cover from "../images/cover.png";
import '../style.css';
function Home() {
    return (
        <div className='container'>
            <div className='rounded shadow position-relative'>
                <div className='z-1 position-absolute mt-3 bg-primary col-4 '>
                    <ul className='d-flex list-unstyled'>
                        <li className='mx-4'>About</li>
                        <li className='mx-4'>Score</li>
                        <li className='mx-4'>Language</li>
                    </ul>
                </div>
            <img src={img_cover} alt='img' className='img_cover rounded' />
            </div>
        </div>
    )
}
export default Home;
